from tensorflow.keras import backend
from tensorflow.keras.layers import Layer
import tensorflow as tf
class MyLayer(Layer):
    def __init__(self, **kwargs):
        global X,Y
        self.X = tf.constant(X, dtype=tf.float32, name="X")
        self.Y = tf.constant(Y, name="Y")
        #self.loc = tf.Variable([[0]], dtype=tf.int64, shape=(1, 1), name = "loc")
        self._trainable = False
        self.y = tf.Variable([[0.0]], dtype=tf.float64, name="y")
        super(MyLayer, self).__init__()
    def call(self, input):
        input = tf.dtypes.cast(input, tf.float32)
        self.loc = tf.where(tf.reduce_all(tf.equal(self.X, input), 1))
        self.y.assign(tf.cond(tf.equal(tf.size(self.loc), 0), lambda: tf.multiply(self.y, 0), lambda: tf.gather_nd(self.Y, self.loc)))
        return self.y
    def build(self, input_shape):
        self.built = True
    def compute_output_shape(self,input_shape):
        return (input_shape[0], 1)
